import React, { Component} from 'react';
import  InputRange  from './InputSlider';

class noValueSlider extends Component {
    render() {
        const value = ''
        return (
            <form className="form">  
                <div className="row">
                    <div className="col-md-2">
                        <p>Enable</p>
                    </div>
                    <div className="col-md-7">
                        <div className="flex-div">
                            <InputRange min={0} max={100} value={0}  onChange={(value)=> this.setState({value})}/>
                            <InputRange min={0} max={100} value={50} />
                            <InputRange min={0} max={100} value={100} />
                        </div>
                    </div>
                </div>
            </form>
        );
    }
}


export default noValueSlider;
